import React from 'react';
import { Form } from 'react-bootstrap';

export const Filter = ( { setIsAvailable } ) => {
  const filterOptions =[
    "All",  "Available", "Borrowed", 
  ];
    return (
    <div>
                {filterOptions.map(option => 
                    <Form.Check
                        inline
                        label={option}
                        type={"checkbox"}
                        id={`inline-checkbox-1`}
                        onChange={(e) => setIsAvailable(e.target.value)}/>)}
    </div>
    );
};
